import React, { useState, useEffect } from 'react'

const Form = () => {
  const [todo, setTodo] = useState('')

  return (
    <div>
      <label>
        <input name='add' value={todo} onChange={e => setTodo(e.target.value)}/>
        + To Do
        {todo}
      </label>
    </div>
  )
}

export default Form
